import {
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";
// import Events from './app/pages/Events/Events';

function App() {
  return (

 <Router>
 <Navbar/>
 <Switch>
          <Route path="/Events">
            <Main />
          </Route>
        </Switch>

        </Router>


  );
}

export default App;
